import { Injectable } from '@angular/core';
import { ComplicationFoie } from '../models/ComplicationFoie';
import { HttpClient, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class CompfoieService {

  private apiUrl = 'https://localhost:7129/api/ComplicationFoies';

  constructor(private http: HttpClient) { }
  addFoie(ComplicationFoie: ComplicationFoie): Observable<HttpResponse<any>> {
    console.log('Creating it with data:', ComplicationFoie);

    return this.http.post<any>(`${this.apiUrl}/addFoie`, ComplicationFoie, { observe: 'response' });
  }}
